import React from 'react'
import { BrowserRouter } from 'react-router-dom'
import 'materialize-css'
import {useRoutes} from './routes'


function App() {
  const routes = useRoutes( isAuthorized = false )
  return (
    <BrowserRouter>
      <div className="cont">
        <h1>Hello</h1>
        { routes }
      </div>
    </BrowserRouter>
  )
}

export default App
